   setUsername(e.target.value)
  }

  const handleSubmit=(e)=>{
    e.preventDefault();
    alert(`Created user,${username}`)
  }
  return (
    <form onSubmit={handleSubmit}>
      <input placeholder='username'value={username} onChange={handleChange}/>
      <button o>Add me to List!</button>
    </form>
  )
}

